import React, { useState } from 'react';
import { Menu, Search, Bell, User, Settings, LogOut } from 'lucide-react';
import AlertNotification from './AlertNotification';

const Header = ({ onMenuClick }) => {
  const [searchQuery, setSearchQuery] = useState('');
  const [showUserMenu, setShowUserMenu] = useState(false);

  const handleSearch = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log('搜索:', searchQuery);
  };

  return (
    <header className="header">
      <div className="flex items-center justify-between px-6 py-4">
        {/* 左侧：菜单按钮和搜索 */}
        <div className="flex items-center space-x-4 flex-1">
          <button
            onClick={onMenuClick}
            className="p-2 hover:bg-bg-tertiary rounded-lg transition-colors"
            aria-label="菜单"
          >
            <Menu className="w-5 h-5 text-text-primary" />
          </button>
          
          {/* 搜索框 */}
          <div className="flex-1 max-w-md">
            <form onSubmit={handleSearch} className="relative">
              <div className="search-container">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 w-4 h-4 text-text-muted" />
                <input
                  type="text"
                  placeholder="搜索项目、任务或团队成员..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  className="w-full pl-10 pr-4 py-2 bg-transparent border-none outline-none text-sm text-text-primary placeholder-text-muted"
                />
              </div>
            </form>
          </div>
        </div>

        {/* 右侧：通知和用户菜单 */}
        <div className="flex items-center space-x-3">
          {/* 智能预警通知 */}
          <AlertNotification />
          
          {/* 用户菜单 */}
          <div className="relative">
            <button
              onClick={() => setShowUserMenu(!showUserMenu)}
              className="flex items-center space-x-2 p-2 hover:bg-bg-tertiary rounded-lg transition-colors"
            >
              <div className="w-8 h-8 bg-gradient-to-r from-primary to-secondary rounded-full flex items-center justify-center">
                <User className="w-4 h-4 text-white" />
              </div>
              <span className="text-sm font-medium text-text-primary hidden md:block">管理员</span>
            </button>

            {/* 用户下拉菜单 */}
            {showUserMenu && (
              <div className="absolute right-0 top-full mt-2 w-48 bg-bg-card border border-border rounded-lg shadow-lg z-50">
                <div className="p-3 border-b border-border">
                  <div className="text-sm font-medium text-text-primary">管理员</div>
                  <div className="text-xs text-text-secondary">admin@company.com</div>
                </div>
                <div className="p-1">
                  <button className="w-full flex items-center space-x-2 px-3 py-2 text-sm text-text-primary hover:bg-bg-tertiary rounded transition-colors">
                    <User className="w-4 h-4" />
                    <span>个人资料</span>
                  </button>
                  <button className="w-full flex items-center space-x-2 px-3 py-2 text-sm text-text-primary hover:bg-bg-tertiary rounded transition-colors">
                    <Settings className="w-4 h-4" />
                    <span>设置</span>
                  </button>
                  <div className="border-t border-border my-1"></div>
                  <button className="w-full flex items-center space-x-2 px-3 py-2 text-sm text-danger hover:bg-danger/10 rounded transition-colors">
                    <LogOut className="w-4 h-4" />
                    <span>退出登录</span>
                  </button>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>

      {/* 点击外部关闭用户菜单 */}
      {showUserMenu && (
        <div 
          className="fixed inset-0 z-40" 
          onClick={() => setShowUserMenu(false)}
        />
      )}
    </header>
  );
};

export default Header;
